@clearskieshi Take me back 3 million years. I want to see Waianae erupt through the ocean. I want to see Koolau join forces a million years later. I want to see a hyperlapse of life carving a foothold on the barren newly formed earth. I want to see the expressions of the first Polynesians to land on this flourishing island. To witness Manoa and Lulumahu and Maunawili before they were raging tourist traps. To see the abundance of this island before it was commercially raped. To see Oahu before freaking parking lots (see last post).
I want to witness the earth before humanity. I want to witness humanity before technology.
I know it's silly but I hope when I die I can experience these things - my soul free to float between time and space to experience past and future universes. That would be my heaven. #watchthisinstagood #instagood10k

